const player = require("../../models/player");

const createPlayer = async (status, name) => {
    const playerExists = await player.findOne({name:name});
    if (err) throw new Error('Something wrong!');
    if (!playerExists){
        let newPlayer = new player({name:name, status:status});
        await newPlayer.save();
        return newPlayer;
    }
}
export { createPlayer as default }

